import React, {Component} from "react";


class ProfilePage extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <React.Fragment>
                <div className="container">
                    <div className="row">
                        <div className="col-12 text-left mt-2">
                            <h4>Marius</h4>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-10">
                            <input className="form-control" type="text" value="Marius" disabled={true}/>
                        </div>
                        <div className="col-2">
                            <button className="btn btn-light border border-secondary pb-0">
                                <span className="material-icons">edit</span>
                            </button>
                        </div>
                    </div>
                </div>

            </React.Fragment>
        );
    }
}

export default ProfilePage;
